import React from 'react';

function Main() {
    return (
        <main className="main">
            <section className="profile">
                <div className="profile__container">
                    <img className="profile__avatar" src="#" alt="аватар"/>
                    <button type="button" className="profile__avatar-button"></button>
                </div>
                <h1 className="profile__title"></h1>
                <button type="button" className="profile__edit-button"></button>
                <p className="profile__subtitle"></p>
                <button type="button" className="profile__add-button"></button>
            </section>
            <section className="cards">
                <template id="card-template" className="card card_type_default">
                    <div className="card__container">
                        <button type="button" className="card__delete-button"></button>
                        <img className="card__image" src="#" alt="#"/>
                        <div className="card__group">
                            <h2 className="card__title"></h2>
                            <div className="card__like-group">
                                <button type="button" className="card__like-button"></button>
                                <span className="card__likes-number">0</span>
                            </div>
                        </div>
                    </div>
                </template>
            </section>
        </main>
    );
}

const editButton = document.querySelector('.profile__edit-button');

editButton.addEventListener('click', () => {
    document.querySelector('.popup-edit').classList.add('popup_opened');
});

